INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (0, 40000, 8, 0, 36, 91002, "", 100, 1, "", 0);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (0, 40001, 8, 107501, 37, 91002, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 150, 1, "ぺコリーヌ", 1);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (0, 40001, 8, 107601, 38, 91002, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 150, 2, "コッコロ", 1);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (0, 40001, 8, 107801, 39, 91002, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 150, 3, "キャル", 1);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (0, 40001, 8, 107701, 40, 91002, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 150, 4, "スズメ", 1);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (0, 40001, 8, 107901, 41, 91002, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 150, 5, "タマキ", 1);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (0, 40001, 8, 107501, 42, 91002, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 150, 6, "ぺコリーヌ", 2);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (0, 40001, 8, 107601, 43, 91002, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 150, 7, "コッコロ", 2);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (0, 40001, 8, 107801, 44, 91002, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 150, 8, "キャル", 2);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (0, 40001, 8, 107701, 45, 91002, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 150, 9, "スズメ", 2);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (0, 40001, 8, 107901, 46, 91002, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 150, 10, "タマキ", 2);
