INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (0, 40011, 2, 125801, 321, 24001, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 1, "リリ", 1);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (0, 40011, 2, 126001, 322, 24001, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 1, 2, "クリア", 1);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (0, 40011, 2, 126101, 323, 24001, "んーと。\nこれ、あげる。\nはい", 1, 3, "プレシア", 1);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (0, 40011, 2, 125801, 324, 24001, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 1, 4, "リリ", 2);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (0, 40011, 2, 126001, 325, 24001, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 1, 5, "クリア", 2);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (0, 40011, 2, 126101, 326, 24001, "お兄。\nきてくれて、うれしい", 1, 6, "プレシア", 2);
